import './App.css';
import axios from "axios";
import React from 'react';


async function getSong(){
  let API = `https//api.spotify.com/v1/search?q=the+end&type=track`;
  const result = await axios.get(API);
  console.log("result");
}

  function App() {
    <div className="App">
      <button onClick={getSong()}> the amazing spotify API button</button>
    </div>
  }

export default App;
